"""
NES Zelda Walking Tour

This is a small project where I grabbed the overworld map data for the 8-bit
NES Zelda game.

This data can be found in overworld/nes_zelda_overworld_tile_map.txt and the
tile graphics can be found in overworld/overworldtiles.png. Use this data if
you'd like to create your own Zelda clone.

(The data used for the map is the giant WORLD_MAP_DATA string, which is
the same as the nes_zelda_overworld_tile_map.txt file contents.)

I then put together this script, where you can explore the overworld map
by walking around. The walking animation is handled by the PygAnim module,
which I wrote to make sprite animation easy in Pygame.

This script should work in both Python 2 and Python 3.

Feel free to email me with any questions about this file: al@inventwithpython.com

NOTE: Currently this program doesn't handle blocking, so you can walk through walls.
"""


